import React, { Component } from 'react'


export default class StepProposition extends React.Component {
    constructor(props) {
        super(props);
    }


    render() {

        const {rows, cols} = this.props;

        return <div className='step-proposition-container'>
            <textarea rows={rows} cols={cols} style={{ resize: 'none', overflow: 'hidden' }}></textarea>
            <div className="frequency-scale-container">
                <form></form>
            </div>
        </div>
    }

}
